	{
	#define progress_x      47
	#define progress_y       5
	#define progress_width 429

	#define background_color 0x000000
	#define foreground_color 0xffffff

	unsigned int progress = progress_width * frame_number / number_of_frames;

	unsigned int *destination = (unsigned int *) background_8888;

	destination += 512 * progress_y + progress_x;


	unsigned int i = 0;
	for (; i < progress_width; i++)
		{
		if (i > progress)
			{
			destination[0] = background_color;
			}
		else
			{
			destination[0] = foreground_color;
			}

		destination ++;
		}
	}


void draw_interface
	(
	unsigned int scale, 
	unsigned int rate, 
	unsigned int number_of_frames, 
	unsigned int frame_number, 
	unsigned int aspect_ratio, 
	unsigned int zoom,
	unsigned int luminosity_boost,
	unsigned int audio_stream,
	unsigned int volume_boost,
	unsigned int loop
	)
	{
	#define aspect_ratio_x      21
	#define aspect_ratio_y      14
	#define aspect_ratio_width  42
	#define aspect_ratio_height  9

	copy_image(0, aspect_ratio_height * aspect_ratio, aspect_ratio_width, aspect_ratio_height, aspect_ratio_width, (unsigned int *) aspect_ratio_8888, aspect_ratio_x, aspect_ratio_y, 512, (unsigned int *) background_8888);


	#define zoom_x 109
	#define zoom_y  14

	copy_number(zoom, zoom_x, zoom_y, 999);


	#define luminosity_boost_x 204
	#define luminosity_boost_y  14

	copy_number(luminosity_boost, luminosity_boost_x, luminosity_boost_y, 99);


	#define audio_stream_x 306
	#define audio_stream_y  14

	copy_number(audio_stream + 1, audio_stream_x, audio_stream_y, 99);


	#define volume_boost_x 376
	#define volume_boost_y  14

	copy_number(volume_boost, volume_boost_x, volume_boost_y, 9);


	#define loop_x      425
	#define loop_y       14
	#define loop_width   18
	#define loop_height   9

	copy_image(0, loop_height * loop, loop_width, loop_height, loop_width, (unsigned int *) loop_8888, loop_x, loop_y, 512, (unsigned int *) background_8888);


	draw_time(frame_number, scale, rate);
	draw_progress(number_of_frames, frame_number);
	}
